metrics.mql:
HEADER { "pname$":"#","channel$":"#","connname$":"#","description$":"#","jobname$":"#","oname$":"#","platform$":"#","qmgr$":"#","rqmname$":"#","type$":"#","url$":"#","gauge$":"#","oid$":"#" , "status$":"#"}
OIDSET { oid:$oid, okind:$okind, onode:$onode }
CATEGORY "telegraf_ibmmq_channel_status_squash" 
TAGLOAD { backward: true }
SELECT ["pcode","pname","channel","connname","description","jobname","oname","platform","qmgr","rqmname","type","url","gauge","oid"]
CREATE { key: status, expr: "gauge ==0?'Stopped':(gauge ==1?'Transition':'Running')" }
CREATE { key: _id_, expr: "oid+'_'+channel+'_'+connname+'_'+jobname" } 
FIRST-ONLY { key: _id_ }
ORDER {key:gauge, sort: desc}

INJECT timepast
HEADER { "gauge$":"#" }
OIDSET { oid:$oid, okind:$okind, onode:$onode }
CATEGORY {"telegraf_ibmmq_channel_status":6h, "telegraf_ibmmq_channel_status{m5}":3d, "telegraf_ibmmq_channel_status{h1}":unlimit } 
TAGLOAD
INJECT default
UPDATE { key: ['gauge'], value: $TIME_MERGE_PLACE }
SELECT [ 'pcode', 'time', 'oid', 'gauge', 'channel', 'qmgr' ]
FILTER { key: "gauge", exist: true }
FILTER { key: "channel", exist: true }
FILTER { key: "qmgr", exist: true }

CREATE { key:_id_, expr: "pcode+'_'+channel+'_'+qmgr" }
CREATE { key:_name_, expr: "channel+' / '+qmgr" }
GROUP { timeunit: 5s, merge: ['gauge'], pk: _id_, last: _name_ }
UPDATE { key: ['gauge'], value: $OBJECT_MERGE_PLACE }

HEADER { "pname$":"#","channel$":"#","connname$":"#","description$":"#","jobname$":"#","oname$":"#","platform$":"#","qmgr$":"#","rqmname$":"#","type$":"#","url$":"#","maxinst$":"#","maxinstc$":"#","oid$":"#","inst_cnt$":"#" }
CATEGORY "telegraf_ibmmq_channel_attribute_max_inst" 
TAGLOAD { backward: true }
SELECT ["pcode","pname","channel","connname","description","jobname","oname","platform","qmgr","rqmname","type","url","gauge","oid"]
FILTER { key: "type", like: "SVRCONN" }
RENAME {src:gauge, dst:maxinst}
JOIN {pk:[channel, jobname, qmgr], query:MAXINSTC, field:[maxinstc]}
JOIN {pk:[channel, jobname, qmgr], query:INSTCOUNT, field:[inst_cnt]}

CREATE { key: _id_, expr: "channel+'_'+jobname+'_'+qmgr" } 
FIRST-ONLY { key: _id_ }


SUB MAXINSTC

CATEGORY "telegraf_ibmmq_channel_attribute_max_instc" 
TAGLOAD {backward:true}
SELECT ["pcode","pname","channel","connname","description","jobname","oname","platform","qmgr","rqmname","type","url","gauge","oid"]

RENAME {src:gauge, dst:maxinstc}

END

SUB INSTCOUNT

CATEGORY telegraf_ibmmq_channel_cur_inst
TAGLOAD {backward:true}
SELECT 
RENAME {src:gauge, dst:inst_cnt}

END
